import React, { Component } from 'react';

import { NonIdealState, H5 } from '@blueprintjs/core';

export default class Route404 extends Component {
   render() {
      const title = <H5>Path not found</H5>;
      const description = (
         <>
            Your search didn't match any files.
            <br />
            Try searching for something else.
         </>
      );

      return (
         <NonIdealState
            icon='issue'
            title={title}
            description={description}
            action=''
         />
      );
   }
}
